import React from "react";

const PlayerSection = (scores) => {
    if (Array.isArray(scores)) {    
        return (

            <table>
                <p>THIS IS PLAYER SECTION</p>
                <thead>
                <tr>Player</tr>
                <tr>Scores</tr>
                </thead>
                <tbody>
                    {scores.map((item) => {
                        return (
                        <tr>
                            <td>{item[0]}</td>
                            <td>{item[1]}</td>
                        </tr>
                        );
                    })}
                </tbody>
            </table>
        );
    }
};
export default PlayerSection;
